import React, {Component} from 'react';
import axios from 'axios';

import { Jumbotron, Container } from 'react-bootstrap';

export default class Home extends Component {

    constructor(props) {
        super(props);
        this.state = {
            name:'',
            email:''
        }
    }

    componentDidMount() {

    }

    render() {
        return (
            <Jumbotron fluid>
                <Container>
                    <h1 style={{ fontFamily: "monospace" }}>Welcome to JobsPlanet</h1>
                    <p>
                    <h6><i>Easiest way to find your dream job!</i></h6>
                    </p>
                    <button
                        style={{
                        width: "150px",
                        borderRadius: "3px",
                        letterSpacing: "1.5px",
                        marginTop: "1rem"
                        }}
                        type="submit"
                        className="btn btn-primary btn-large waves-effect waves-light hoverable blue accent-3"
                    >
                        <a style={{
                        color: "white",
                        }} href="/login">Login</a>
                    </button>
                </Container>
            </Jumbotron>
        )
    }
}
